    }
    ready
    kubernetes cluster.local net in-addr.arpa ip6.arpa {
       pods insecure
       ttl 30
    }
    prometheus :9153
    forward . 8.8.8.8 {
       max_concurrent 1000
    }
    cache 30
    reload
    loadbalance
}

